import {Header,WhatComp, Features, CTA, Working, Testimonials} from '../index';

const Home = () => {
    return (
        <>
            <Header/>
            <WhatComp/>
            <Features/>
            <Working/>
            <CTA/>
            <Testimonials/>
        </>
    )
}

export default Home
